<template>
  <v-main class="main">
    <div class="hornet"><span>{{hornets.normal}}</span></div>
    <div class="hornet reverse"><span>{{hornets.reverse}}</span></div>
  </v-main>
</template>
<style scoped>
@-webkit-keyframes glow {
    from {opacity: 1;}
    50% {opacity: 0.4;}
    to {opacity: 1;}
}
.main {
  background: #aaaaff;
  color: rgb(141, 0, 162);
}
.hornet span {
  display: inline-block;
  background: white;
  color: black;
  width: 50px;
  height: 50px;
  line-height: 50px;
  font-weight: bold;
  font-size: 18px;
  border-radius: 50%;
  border: 2px solid black;
  position: absolute;
  right: 25px;
  top: 16px;
  transform: rotate(-10deg);
  color:red; 
}
.hornet.reverse {
  transform: rotate(180deg);
  margin-left: 0;
}
.hornet.reverse span{
  transform: rotate(170deg);
  color: green;
}
.hornet {
  position: relative;
  width: 221px;
  height: 115px;
  margin-left: 6px;
  background-repeat: no-repeat !important;
  background-size: contain !important;
  background: url('data:image/png;base64,')
}
.controls {
  position: fixed;
  bottom: 0;
  right: 0;
}
</style>
<script>

export default {
  name: "Intro",
  data() {
    return {
      hornets: {
        normal: 11,
        reverse: 98
      }
    };
  },
  computed: {
  },
  methods: {
    _syncStorage: function() {
      const self = this;
      localStorage.setItem("hornets", JSON.stringify(self.hornets));
    },
    _loadStorage: function() {
      const self = this;
      self.hornets = JSON.parse(localStorage.getItem("hornets")) || {normal: 0, reverse: 0};
    },
    _bindControls(e) {
      const self = this;
      switch(e.keyCode){
        case 40:  // abajo
          if(e.shiftKey) { self.hornets.reverse--; }
          else { self.hornets.reverse++; }
          break;
        case 38:  // arriba
          if(e.shiftKey) { self.hornets.normal--; }
          else { self.hornets.normal++; }
          break;
        default:
          console.log(e);
      }
      self._syncStorage();
    },
  },
  created() {
    const self = this;
    self._loadStorage();
  },
  filters:{
  },
  mounted() {
    const self = this;
    document.title="HitCounter";
    window.removeEventListener('keydown', self._bindControls);
    window.addEventListener('keydown', self._bindControls);
  },
};
</script>
